function sysmes(config) {
  // config: {message: 'text'}
  $('.sysmes').velocity("stop", true).remove();
  var message = (config.message != null && config.message != '') ? config.message : 'Click elsewhere. This is a prototype, not everything works.';
  var position = (config.position != null && config.position != '') ? config.position : 'bottom-right';
  var durationIn = 300;
  var durationOut = 300;
  var delay = (config.delay != null && config.delay != '') ? config.delay : 2000;
  var persist = (config.persist != null && config.persist != '') ? true : false;
  var background = (config.background != null && config.background != '') ? config.background : '#404040';

  $('body').append('' +
    '<div class="sysmes sysmes-'+position+'">'+
      '<span style="background:'+background+'">'+
        message +
        '<div class="remove" style="display:'+ ((persist) ? 'inline-block' : 'none') +';">' +
          '<svg width="12px" height="12px" viewBox="0 0 16 16" version="1.1" xmlns="http://www.w3.org/2000/svg">' +
            '<path d="M5.53846154,8 L1.23076923,3.69230769 L-7.05452248e-14,2.46153846 L2.46153846,5.32907052e-15 L3.69230769,1.23076923 L8,5.53846154 L12.3076923,1.23076923 L13.5384615,1.26170601e-14 L16,2.46153846 L14.7692308,3.69230769 L10.4615385,8 L14.7692308,12.3076923 L16,13.5384615 L13.5384615,16 L12.3076923,14.7692308 L8,10.4615385 L3.69230769,14.7692308 L2.46153846,16 L-7.90478794e-14,13.5384615 L1.23076923,12.3076923 L5.53846154,8 L5.53846154,8 Z"></path>' +
          '</svg>' +
        '</div>' +
      '</span>' +
    '</div>'
  );

  $('.sysmes').on('click', '.remove', function() {
    $('.sysmes')
    .velocity({
      opacity: 0,
      translateY: '40px'
    }, {
      duration: durationOut,
      complete: function() {
        $('.sysmes').velocity("stop", true).remove();
      }
    });
  });

  $('.sysmes')
  .velocity({
    opacity: 1,
    translateY: '-40px'
  }, {
    duration: durationIn,
    easing: 'easeInOut'
  })

  if(!persist) {
    $('.sysmes')
    .velocity({
      opacity: 0,
      translateY: '40px'
    }, {
      duration: durationOut,
      delay: delay,
      complete: function() {
        $('.sysmes').velocity("stop", true).remove();
      }
    });
  }
};
