  // FUNCTIONS /////////////////////////////////////////////////

  function showStackNavigatorDropdown(trigger) {
    var obj = trigger.closest('.stack');
    var btn = trigger.closest('.btn-icon-more');
    var index = stack.indexOf(obj.attr('data-stack'));
    var dropdown = $('.stack-nav-dropdown');

    btn.addClass('active');

    // setup dropdown contents
    setupStackNavigatorDropdownContents();

    // position dropdown
    dropdown.css({
      'left': btn.offset().left,
      'top': btn.offset().top + 90
    });

    // show dropdown
    dropdown
      .velocity({
        opacity: 1
      }, {
        visibility: 'visible',
        duration: 150
      });

    // bind close handler
    $(document).on('click.dropdown', function(event) {
      if (!$(event.target).closest('.stack-nav-dropdown').length && !$(event.target).closest('[data-aid="dropdown-stack"]').length) {
        btn.removeClass('active');
        $('.stack-nav-dropdown')
          .off('dropdown')
          .velocity({
            opacity: 0
          }, {
            visibility: 'hidden',
            duration: 150
          });
      }
    });
  }

  function setupStackNavigatorDropdownContents() {
    console.log('setup dropdown contents');
    var list = $('.stack-nav-dropdown >').find('li');
    var current_stack = stack[stack.length - 1];
    var match = false;
    for (var i = list.length - 2; i >= 0; i--) {
      if (match === false) {
        if (current_stack === list[i].getAttribute('data-stack')) {
          match = true;
          list.eq(i).removeClass('on');
        } else {
          list.eq(i).addClass('on');
        }
      } else {
        list.eq(i).removeClass('on');
      }
    };
  }

  function gotoStack(data) {
    $(document).triggerHandler('click.dropdown');
    while (data !== stack[stack.length - 1]) {
      var trigger = $('.stack[data-stack="' + stack[stack.length - 1] + '"]').find('[data-aid="remove-stack"]');
      removeStack(trigger);
    }
  }

  function closeStacks() {
    $(document).triggerHandler('click.dropdown');
    while (stack.length !== 0) {
      var trigger = $('.stack[data-stack="' + stack[stack.length - 1] + '"]').find('[data-aid="remove-stack"]');
      removeStack(trigger);
    }
  }

