  function addStack(obj) {
    var backdrop = obj.find('.backdrop');
    var panel = obj.find('.panel');
    stack.push(obj.attr('data-stack'));
    var index = stack.indexOf(obj.attr('data-stack'));

    if (index > -1) {

      // show backdrop
      backdrop
        .velocity({
          translateZ: 0,
          opacity: 0.3
        }, {
          visibility: 'visible',
          duration: 300,
          easing: 'ease-in-out'
        });

      // show panel
      panel
        .css({
          'left': ((index + 1) * stack_inc).toString() + 'px'
        })
        .velocity({
          opacity: 1,
          translateZ: 0,
          translateX: [0, +stack_animation_inc]
        }, {
          visibility: 'visible',
          duration: 300,
          easing: 'ease-in-out',
          complete: function() {
            $.doTimeout(900, function() {
              compressStacks(obj, index);
            });
          }
        });
    }

    if (index > stack_limit) {
      showStackNavigator(obj);
    }

    // show contents
    showSpinner(panel, '#ffffff');
    $.doTimeout(600, function() {
      hideSpinner();
    });
    console.log(stack);
  }

  function removeStack(trigger) {
    var obj = trigger.closest('.stack');
    var index = stack.indexOf(obj.attr('data-stack'));
    var backdrop = obj.find('.backdrop');
    var panel = obj.find('.panel');

    // hide backdrop
    backdrop
      .velocity({
        translateZ: 0,
        opacity: 0
      }, {
        visibility: 'hidden',
        duration: 300,
        easing: 'ease-in-out',
      });

    // hide panel
    panel
      .velocity({
        opacity: 0,
        translateZ: 0,
        translateX: [+stack_animation_inc, 0]
      }, {
        visibility: 'hidden',
        duration: 300,
        easing: 'ease-in-out',
        complete: function() {
          panel
            .css({
              'transform': 'translate(0, 0)'
            })
          $.doTimeout(500, function() {
            expandStacks(obj, index);
          });
        }
      });

    if (index > -1) {
      stack.splice(index, 1);
    }
    console.log(stack);
  }

  function compressStacks(obj, index) {
    if (index === stack_limit) {
      stack_inc = 20;
      for (var i = 0; i < index + 1; i++) {
        var openstackpanel = $(".stack[data-stack='" + stack[i] + "']").find('.panel');
        openstackpanel
          .velocity({
            translateZ: 0,
            'left': ((i + 1) * stack_inc).toString() + 'px',
            translateX: [0, 0]
          }, {
            duration: 300,
            easing: 'ease-in-out'
          });
      }
      // animate stack navigator
      $.doTimeout(300, function() {
        animateStackNavigator(obj);
      });
    }
  }

  function expandStacks(obj, index) {
    if (index === stack_limit) {
      stack_inc = 100;
      hideStackNavigator(obj);
      for (var i = 0; i < index + 1; i++) {
        var openstackpanel = $(".stack[data-stack='" + stack[i] + "']").find('.panel');
        openstackpanel.velocity({
          translateZ: 0,
          'left': ((i + 1) * 100).toString() + 'px'
        }, {
          duration: 300,
          easing: 'ease-in-out'
        });
      };
    }
  }

