function content_tree() {

  var tree = $('.ctf-content-tree');
  $('.ctf-content-tree > ul > li > ul').find('ul').not('.list_ul').hide(); // contract tree
  tree.find('.title[id]').css({'cursor':'pointer'}); // dismiss not-allowed cursor on active title elements

  // set entry
  $('.entry-placeholder[data-entry="guide-to-france"]').addClass('active');
  showSpinner($('.entry-placeholder[data-entry="guide-to-france"]'), '#ffffff');
  $.doTimeout(600, function() {
    hideSpinner();
  });

  // hover on tree items
  tree.find('.title').on('mouseenter', function() {
    var parent_offset = tree.offset().top;
    var active_offset = $(this).offset().top;
    var hl_offset = active_offset - parent_offset + 15;
    tree.find('.hover').css('top', hl_offset + 'px').addClass('active');
  });
  tree.find('.title').on('mouseleave', function() {
    tree.find('.hover').removeClass('active');
  });

  // toggle tree item
  tree.find('.btn-toggle').each(function() {
    $(this).on('click', function(e) {
      e.stopImmediatePropagation();
      if(!$(this).hasClass('active')) {
        $(this).siblings('ul').not('.list_ul').slideDown(100);
        $(this).addClass('active');
      } else {
        $(this).siblings('ul').not('.list_ul').slideUp(100);
        $(this).removeClass('active');
      }
    });
  });

  // activate tree item
  tree.find('[data-entry]').on('click', function(e) {
    var el = $(this)[0];
    if(!$(el).hasClass('active')) {
      $('[data-aid="toggle-left-sidebar"]').triggerHandler('click');
      expandTree($(el));
      var data = $(this)[0].getAttribute('data-entry');
      $('.ctf-placeholder_body').find('.entry-placeholder').removeClass('active');
      $('.entry-placeholder[data-entry="'+ data +'"]').addClass('active');
      showSpinner($('.entry-placeholder[data-entry="'+ data +'"]'), '#ffffff');
      $.doTimeout(600, function() {
        hideSpinner();
      });
    }

  });


  // FUNCTIONS //////////////////////////////////////////////////////////////////

  function expandTree(obj) {
    tree.find('.title').removeClass('active');
    obj.addClass('active');
    obj.siblings('.btn-toggle').addClass('active');
    obj.siblings('ul').not('.list_ul').show(300);
    tree.find('.selected').remove();
    obj.parent().prepend('<div class="selected"></div>');
  }

}
